import React, { useState, useEffect } from "react";
import axios from "axios";
function Apidata() {
  const [data, setData] = useState({});

  useEffect(() => {
    handleData();
  }, []);

  const handleData = async () => {
    try {
      await axios
        .get(
          "https://api.openweathermap.org/data/2.5/weather?q=mohali&units=metric&appid=effecea7baccf16912338e128c2f0bf8"
        )
        .then((result) => {
          console.log(result.data.main.temp);
          const info = result.data.main;
          setData(info);
        });
    } catch (error) {
      console.log("api error", error);
    }
  };
  return (
    <div>
      <h1>Crypto Data</h1>
      {data.map((item) => (
        <p>{item.temp}</p>
      ))}
    </div>
  );
}

export default Apidata;
